package com.ramitsuri.podcasts.utils

import io.ktor.client.engine.mock.MockEngine
import io.ktor.client.engine.mock.MockRequestHandleScope
import io.ktor.client.engine.mock.respond
import io.ktor.http.HttpStatusCode
import io.ktor.http.headersOf

class PodcastsApiMockEngine {
    var respondWithSuccess = true

    val engine =
        MockEngine { request ->
            val path = request.url.encodedPath
            when {
                path.contains("podcasts/trending") -> {
                    if (respondWithSuccess) {
                        respondJson(trendingResponse)
                    } else {
                        respondJson("")
                    }
                }

                path.contains("search/byterm") -> {
                    if (respondWithSuccess) {
                        respondJson(searchResponse)
                    } else {
                        respondJson("")
                    }
                }

                else -> error("Not implemented yet")
            }
        }

    private fun MockRequestHandleScope.respondJson(
        content: String,
        status: HttpStatusCode = HttpStatusCode.OK,
    ) = respond(
        content,
        status,
        headersOf(
            "content-type",
            "application/json",
        ),
    )

