ate fluff, no B.S.\u2014just real talk from people who have been in the trenches, built successful businesses, and know what it takes to win in this space.<\/p><p>Luke Eggebraaten is the founder of <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https:\/\/linktr.ee\/phasermarketing\">Phaser Marketing<\/a> and the author of <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https:\/\/www.amazon.com\/Digital-Dirt-World-Construction-Companies\/dp\/B0BW23B1ZY\">Digital Dirt World<\/a>. Since 2019, he has been helping excavation companies scale their online presence through web design, SEO, and paid ads. His team has worked with businesses doing ${'$'}500K to ${'$'}100M in revenue, offering tailored marketing solutions that drive real growth. With a passion for connecting the construction industry to the digital age, Luke brings a wealth of knowledge and experience to every episode.<\/p><p>The biggest names in excavation, septic, snow removal, landscaping, outdoor services, and more share their insights, lessons, and strategies, giving listeners direct access to the minds of industry leaders who are making waves and building empires. The Dirt Bags Podcast covers everything from marketing and branding, to leadership, business growth, equipment talk, and job site war stories. Industry experts, business owners, and hardworking professionals bring real experiences and hard-earned wisdom to every episode.<\/p><p>This isn\u2019t a typical business podcast\u2014it\u2019s organized but laid-back, full of uncensored, real-world advice from people who get it. New episodes drop first thing in the morning, 2-3 Fridays a month, so listeners can tune in on the way to the job site or while working on the job.<\/p><p>Construction, business, and success\u2014Dirt Bag style! <\/p><p>LETS GO<\/p>","author":"Luke Eggebraaten","image":"https:\/\/media.rss.com\/dirtbagspodcast\/20220203_020233_d39e2bc7b00d234f3b5145a310e72b9f.jpg","artwork":"https:\/\/media.rss.